import React from "react";
import importFishStyle from "../../styles/ImportFish.module.scss";
const ImportFish = () => {
  return (
    <div className={importFishStyle.importFish}>
      <h2 id="hometitle" className={importFishStyle.homeTitle}>
        Cá Biển Nhập Khẩu
      </h2>
      <div id="product" className="row">
            <div>
            <div className="card text-left">
          <img className="card-img-top" src="holder.js/100px180/" alt />
          <div className="card-body">
            <h4 className="card-title">Title</h4>
            <p className="card-text">Body</p>
          </div>
        </div>
            </div>
      </div>
    </div>
  );
};

export default ImportFish;
